import React from 'react';
import { Icon } from '@iconify/react';
import umlogo from '../assets/images/umlogo.svg';

const DashboardSidebar = () => {
  return (
    <div className="absolute top-4 left-4 w-20 h-full bg-white bg-opacity-30 text-white flex flex-col z-10">
      <div className="flex flex-col gap-3 justify-center items-center mt-5">
        <img src={umlogo} className="w-12" alt="um-logo"/>
        <p className="font-light text-sm">urbanMind</p>
      </div>
      <div className="flex flex-col gap-3 justify-center items-center mt-5">
        <Icon icon="heroicons:home-20-solid" width="24" style={{ color: "#ffffff" }} />
        <Icon icon="heroicons:home-20-solid" width="24" style={{ color: "#ffffff" }} />
        <Icon icon="heroicons:home-20-solid" width="24" style={{ color: "#ffffff" }} />
        <Icon icon="heroicons:home-20-solid" width="24" style={{ color: "#ffffff" }} />
        <Icon icon="heroicons:home-20-solid" width="24" style={{ color: "#ffffff" }} />
        <Icon icon="heroicons:home-20-solid" width="24" style={{ color: "#ffffff" }} />
      </div>
    </div>
  );
};

export default DashboardSidebar;
